import React, { useEffect, useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';

function SVARPage() {
  const [svArData, setSvArData] = useState([]);
  const [svHistory, setSvHistory] = useState([]);
  const [showHistory, setShowHistory] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      const userEmail = localStorage.getItem('userEmail');
      if (!userEmail) {
        navigate('/');
        return;
      }

      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setSvArData(result.violationsData || []);
        setSvHistory(result.svHistory || []);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  return (
    <div style={{ display: "flex", minHeight: "100vh", fontFamily: "Arial, sans-serif" }}>
      {/* Sidebar */}
      <div style={{ backgroundColor: "#d32f2f", color: "#fff", width: "200px", padding: "20px" }}>
        <img src="/fiesta-logo.png" alt="Fiesta Logo" style={{ width: "150px", marginBottom: "20px" }} />
        <nav>
          <ul style={{ listStyle: "none", padding: 0 }}>
            <li><Link to="/dashboard" style={{ color: "#fff", textDecoration: "none" }}>Dashboard</Link></li>
            <li><Link to="/sv-ar" style={{ color: "#fff", textDecoration: "none" }}>Current SV & AR</Link></li>
          </ul>
        </nav>
        <button onClick={handleLogout} style={{ marginTop: "20px", backgroundColor: "#fff", color: "#d32f2f", border: "none", padding: "5px 10px", cursor: "pointer", borderRadius: "3px" }}>Logout</button>
      </div>

      {/* Main Content */}
      <div style={{ flex: 1, backgroundColor: "#f9f9f9", padding: "20px" }}>
        <h2>Current Scanning Violations & ARs</h2>
        {svArData.map((item, index) => (
          <div key={index} style={{ marginBottom: "10px", backgroundColor: "#fff", padding: "10px", borderRadius: "5px" }}>
            {Object.entries(item).map(([key, value]) => (
              <div key={key}><strong>{key}:</strong> {value || "N/A"}</div>
            ))}
          </div>
        ))}

        <button onClick={() => setShowHistory(!showHistory)} style={{ backgroundColor: "#d32f2f", color: "#fff", border: "none", padding: "5px 10px", cursor: "pointer", borderRadius: "3px", marginTop: "10px" }}>
          {showHistory ? "Hide SV & AR History" : "Show SV & AR History"}
        </button>

        {showHistory && (
          <div style={{ marginTop: "20px" }}>
            <h3>SV & AR History</h3>
            {svHistory.map((item, index) => (
              <div key={index} style={{ marginBottom: "10px", backgroundColor: "#fff", padding: "10px", borderRadius: "5px" }}>
                {Object.entries(item).map(([key, value]) => (
                  <div key={key}><strong>{key}:</strong> {value || "N/A"}</div>
                ))}
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}

export default SVARPage;
